Quousque tandem abutere Catilina patientia nostra quousque uel quamdiu male uteris, Catilina, patientiam nostram V 238, 25 (Cic. Cat. I 1). increpantium est, principium libri Ciceronis, quod Catellina senator perditus ciuium sub consule Cicerone male uiuendo patientia ipsius Ciceronis male utebatur: abutere male uteris V 327, 26. Cf. IV 384, 26 (quousque tandem abutere Catillina[m] patientia nostra) et 
quousque tandem quousque moram facit (?) IV 421, 29; 
quousque tandem quousque moram V 238, 24. Cf. Hagen Grad. ad cr. p. 99.
